import React from 'react';
import logo from './assets/image.png'; // Adjust the path
<img src={logo} alt="Logo" />

function Header() {
  return (
    <div className="header" style={{ background: '#fff', height: 100, display: 'flex', alignItems: 'center', boxShadow: '0 2px 10px rgba(0,0,0,0.05)', position: 'relative' }}>
      <img src={logo} alt="Logo" style={{ height: 60, marginLeft: 24 }} />
      <div className="your-profile-label" style={{ display: 'none' }} />
      <div className="edit-icon" style={{ display: 'none' }} />
    </div>
  );
}

export default Header;
